export const CONSULTORIO = "consultorio/CONSULTORIO";

export const types = {
    CONSULTORIO_REQUEST: `${CONSULTORIO}_REQUEST`,
    CONSULTORIO_SUCCESS: `${CONSULTORIO}_SUCCESS`,
    CONSULTORIO_ERROR: `${CONSULTORIO}_ERROR`,
};

export const INITIAL_STATE = {
    fetching: false,
};
export default (state = INITIAL_STATE, action = {}) => {
    switch (action.type) {
        case types.CONSULTORIO_REQUEST:
            return {
                ...state,
                fetching: true,
            };
        case types.CONSULTORIO_SUCCESS:
            return {
                ...state,
                fetching: false,
            };
        case types.CONSULTORIO_ERROR:
            return {
                ...state,
                fetching: false,
            };

        default:
            return state;
    }
};

export const actions = {
    listconsultorioReq: (setList) => ({
        type: types.CONSULTORIO_REQUEST,
        setList,
    }),
    listconsultorioSuccess: () => ({
        type: types.CONSULTORIO_SUCCESS,
    }),
    listconsultorioError: () => ({
        type: types.CONSULTORIO_ERROR,
    }),
};

export const selectors = {
    isFetching: () => fetching,
};
